interface TVShowsPageProps {
  searchQuery: string;
}

export const TVShowsPage: React.FC<TVShowsPageProps> = ({ searchQuery }) => {
  const [selectedGenre, setSelectedGenre] = useState('all');
  const [selectedStatus, setSelectedStatus] = useState<'all' | 'ongoing' | 'completed' | 'upcoming'>('all');
  const [sortBy, setSortBy] = useState<'rating' | 'year' | 'title'>('rating');

  const genres = ['all', 'Drama', 'Comedy', 'Sci-Fi', 'Horror', 'Fantasy', 'Action', 'Mystery', 'Romance', 'Thriller'];

  // Filter TV shows
  const filteredShows = tvShows.filter(show => {
    const matchesSearch = show.title.toLowerCase().includes(searchQuery.toLowerCase()) ||
                         show.description.toLowerCase().includes(searchQuery.toLowerCase()) ||
                         show.cast.some(actor => actor.toLowerCase().includes(searchQuery.toLowerCase()));
    
    const matchesGenre = selectedGenre === 'all' || show.genre.some(g => g.toLowerCase() === selectedGenre.toLowerCase());
    const matchesStatus = selectedStatus === 'all' || show.status === selectedStatus;
    
    return matchesSearch && matchesGenre && matchesStatus;
  });

  // Sort shows
  const sortedShows = [...filteredShows].sort((a, b) => {
    switch (sortBy) {
      case 'rating':
        return b.rating - a.rating;
      case 'year':
        return b.year - a.year;
      case 'title':
        return a.title.localeCompare(b.title);
      default:
        return 0;
    }
  });

  const getStatusColor = (status: string) => {
    switch (status) {
      case 'ongoing': return 'bg-green-500/20 text-green-400';
      case 'completed': return 'bg-blue-500/20 text-blue-400';
      case 'upcoming': return 'bg-yellow-500/20 text-yellow-400';
      default: return 'bg-gray-500/20 text-gray-400';
    }
  };

  const topRatedShows = tvShows.filter(show => show.rating >= 8.5).slice(0, 3);

  return (
    <div className="min-h-screen bg-gray-900">
      {/* Background Animation */}
      <div className="fixed inset-0 overflow-hidden pointer-events-none">
        <div className="absolute top-20 left-10 w-32 h-32 bg-purple-500/5 rounded-full animate-pulse"></div>
        <div className="absolute top-40 right-20 w-24 h-24 bg-blue-500/5 rounded-full animate-bounce" style={{ animationDelay: '1s' }}></div>
        <Tv className="absolute top-1/3 left-10 w-16 h-16 text-white/5 animate-spin" style={{ animationDuration: '25s' }} />
      </div>

      <div className="relative z-10 pt-24 pb-12">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
          {/* Header */}
          <div className="text-center mb-12">
            <h1 className="text-5xl md:text-6xl font-bold bg-gradient-to-r from-white via-purple-200 to-purple-400 bg-clip-text text-transparent mb-6">
              TV Shows Collection
            </h1>
            <p className="text-xl text-gray-300 max-w-3xl mx-auto leading-relaxed">
              Binge-watch the latest series, discover hidden gems, and catch up on your favorite shows. From gripping dramas to hilarious comedies.
            </p>
          </div>

          {/* Top Rated Shows */}
          <section className="mb-16">
            <div className="flex items-center space-x-2 mb-8">
              <TrendingUp className="w-6 h-6 text-purple-500" />
              <h2 className="text-3xl font-bold text-white">Top Rated Shows</h2>
            </div>
            <div className="grid grid-cols-1 md:grid-cols-3 gap-8">
              {topRatedShows.map((show) => (
                <div
                  key={show.id}
                  className="group relative bg-gradient-to-br from-gray-800/80 to-gray-900/80 backdrop-blur-sm rounded-2xl overflow-hidden shadow-2xl hover:shadow-purple-500/20 transition-all duration-500 hover:scale-105 cursor-pointer"
                >
                  <div className="relative overflow-hidden">
                    <img
                      src={show.backdrop}
                      alt={show.title}
                      className="w-full h-48 object-cover transition-transform duration-500 group-hover:scale-110"
                    />
                    <div className="absolute inset-0 bg-gradient-to-t from-black/80 via-transparent to-transparent"></div>
                    <div className="absolute top-4 right-4 bg-black/60 backdrop-blur-sm px-3 py-1 rounded-full flex items-center space-x-1">
                      <Star className="w-4 h-4 text-yellow-400 fill-current" />
                      <span className="text-white font-medium">{show.rating}</span>
                    </div>
                    <div className={`absolute top-4 left-4 px-2 py-1 rounded-full text-xs font-medium ${getStatusColor(show.status)}`}>
                      {show.status.charAt(0).toUpperCase() + show.status.slice(1)}
                    </div>
                  </div>
                  <div className="p-6">
                    <h3 className="text-white font-bold text-xl mb-2">{show.title}</h3>
                    <p className="text-gray-300 text-sm mb-4 line-clamp-2">{show.description}</p>
                    <div className="flex items-center justify-between text-gray-400 text-sm">
                      <span>{show.seasons} Season{show.seasons > 1 ? 's' : ''}</span>
                      <span>{show.network}</span>
                    </div>
                  </div>
                </div>
              ))}
            </div>
          </section>

          {/* Filters and Controls */}
          <div className="flex flex-col lg:flex-row lg:items-center lg:justify-between mb-8 space-y-4 lg:space-y-0">
            <div className="flex flex-col sm:flex-row sm:items-center space-y-4 sm:space-y-0 sm:space-x-4">
              <h2 className="text-3xl font-bold text-white">
                {searchQuery ? `Search Results for "${searchQuery}"` : 'All TV Shows'}
              </h2>
              <span className="text-gray-400">({sortedShows.length} shows)</span>
            </div>
            
            <div className="flex flex-col sm:flex-row space-y-4 sm:space-y-0 sm:space-x-4">
              {/* Sort Options */}
              <select
                value={sortBy}
                onChange={(e) => setSortBy(e.target.value as any)}
                className="bg-gray-800 border border-gray-700 rounded-lg px-3 py-2 text-white text-sm focus:outline-none focus:ring-2 focus:ring-purple-500"
              >
                <option value="rating">Sort by Rating</option>
                <option value="year">Sort by Year</option>
                <option value="title">Sort by Title</option>
              </select>
              
              {/* Status Filter */}
              <select
                value={selectedStatus}
                onChange={(e) => setSelectedStatus(e.target.value as any)}
                className="bg-gray-800 border border-gray-700 rounded-lg px-3 py-2 text-white text-sm focus:outline-none focus:ring-2 focus:ring-purple-500"
              >
                <option value="all">All Status</option>
                <option value="ongoing">Ongoing</option>
                <option value="completed">Completed</option>
                <option value="upcoming">Upcoming</option>
              </select>
              
              {/* Genre Filter */}
              <select
                value={selectedGenre}
                onChange={(e) => setSelectedGenre(e.target.value)}
                className="bg-gray-800 border border-gray-700 rounded-lg px-3 py-2 text-white text-sm focus:outline-none focus:ring-2 focus:ring-purple-500"
              >
                {genres.map(genre => (
                  <option key={genre} value={genre}>
                    {genre === 'all' ? 'All Genres' : genre}
                  </option>
                ))}
              </select>
            </div>
          </div>

          {/* TV Shows Grid */}
          <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-6">
            {sortedShows.map((show) => (
              <div
                key={show.id}
                className="group bg-gray-800/50 backdrop-blur-sm rounded-xl overflow-hidden shadow-lg hover:shadow-2xl transition-all duration-500 hover:scale-105 cursor-pointer"
              >
                <div className="relative overflow-hidden">
                  <img
                    src={show.poster}
                    alt={show.title}
                    className="w-full h-80 object-cover transition-transform duration-500 group-hover:scale-110"
                  />
                  
                  <div className="absolute inset-0 bg-gradient-to-t from-black/80 via-transparent to-transparent opacity-0 group-hover:opacity-100 transition-opacity duration-300" />
                  
                  {/* Play Button */}
                  <div className="absolute inset-0 flex items-center justify-center opacity-0 group-hover:opacity-100 transition-opacity duration-300">
                    <button className="bg-white/20 backdrop-blur-sm text-white p-3 rounded-full hover:bg-white/30 transition-colors duration-200">
                      <Play className="w-6 h-6" />
                    </button>
                  </div>

                  {/* Rating Badge */}
                  <div className="absolute top-3 right-3 bg-black/60 backdrop-blur-sm px-2 py-1 rounded-lg flex items-center space-x-1">
                    <Star className="w-4 h-4 text-yellow-400 fill-current" />
                    <span className="text-white text-sm font-medium">{show.rating}</span>
                  </div>

                  {/* Status Badge */}
                  <div className={`absolute top-3 left-3 px-2 py-1 rounded-full text-xs font-medium ${getStatusColor(show.status)}`}>
                    {show.status.charAt(0).toUpperCase() + show.status.slice(1)}
                  </div>
                </div>

                <div className="p-4">
                  <h3 className="text-white font-semibold text-lg mb-2 line-clamp-1">{show.title}</h3>
                  
                  <div className="flex items-center justify-between text-gray-400 text-sm mb-3">
                    <div className="flex items-center space-x-1">
                      <Calendar className="w-4 h-4" />
                      <span>{show.year}</span>
                    </div>
                    <div className="flex items-center space-x-1">
                      <Users className="w-4 h-4" />
                      <span>{show.seasons}S</span>
                    </div>
                  </div>

                  <div className="flex flex-wrap gap-1 mb-3">
                    {show.genre.slice(0, 2).map((genre) => (
                      <span key={genre} className="px-2 py-1 bg-gray-700 text-gray-300 rounded text-xs">
                        {genre}
                      </span>
                    ))}
                  </div>

                  <p className="text-gray-300 text-sm line-clamp-2 mb-3">{show.description}</p>
                  
                  <div className="text-gray-400 text-xs">
                    <span className="font-medium">{show.network}</span>
                  </div>
                </div>
              </div>
            ))}
          </div>

          {sortedShows.length === 0 && (
            <div className="text-center py-16">
              <Tv className="w-16 h-16 text-gray-600 mx-auto mb-4" />
              <div className="text-gray-400 text-xl mb-4">No TV shows found</div>
              <p className="text-gray-500">Try adjusting your search or filter criteria</p>
            </div>
          )}
        </div>
      </div>
    </div>
  );
};